import React from "react";

const Oeffnungszeiten = () => {
    return (
        <div className="oeffnungszeiten textbox" id="oeffnungszeiten">

            <h1>Öffnungszeiten</h1>

            <p>Unsere Winteröffnungszeiten ab 1. Dezember bis 28. Februar:</p>
            <p>Im Weingut</p>
            <p>Mo.-Fr. 9 Uhr bis 17.30 Uhr; Sa. 9 Uhr bis 13 Uhr; So. nach Vereinbarung</p>
            <p>In der Vinothek</p>
            <p>Dezember, Januar und Februar Winterpause - wir bedienen Sie in dieser Zeit gerne im Weingut!</p>




        </div>
    );
}

export default Oeffnungszeiten;
